const AdministratorRole = {"ID": 1, "Role": "Администратор"}
const JuniorOperatorRole = {"ID": 2, "Role": "Младший оператор"}
const SeniorOperatorRole = {"ID": 3, "Role": "Старший оператор"}

module.exports = {
    "Roles": {
        "AdministratorRole": AdministratorRole,
        "JuniorOperatorRole": JuniorOperatorRole, 
        "SeniorOperatorRole": SeniorOperatorRole
    },
}
